import React, { useState, useEffect } from "react";
import { fetchTrades } from "./ApiCalls";
import Sort from "./Sort";

const TradeSum = () => {
  // eslint-disable-next-line
  const [dailyTrades, setDailyTrades] = useState([]);
  const [weeklyTrades, setWeeklyTrades] = useState([]);
  const [monthlyTrades, setMonthlyTrades] = useState([]);

  useEffect(() => {
    const fetchAndCategorizeTrades = async () => {
      try {
        const trades = await fetchTrades();
        const today = new Date();

        // Get the start of the week (Sunday)
        const startOfWeek = new Date(today);
        startOfWeek.setDate(today.getDate() - today.getDay());

        // Get the start of the month
        const startOfMonth = new Date(today.getFullYear(), today.getMonth(), 1);

        const daily = [];
        const weekly = [];
        const monthly = [];

        trades.forEach((trade) => {
          const tradeDate = trade.entryDate;
          const tradeEntryDateStr = tradeDate.toDateString();

          // Check if the trade entry date is today
          if (tradeEntryDateStr === today.toDateString()) {
            daily.push(trade);
          }

          // Check if the trade entry date is within the current week (Sunday to Saturday)
          if (tradeDate >= startOfWeek && tradeDate <= today) {
            weekly.push(trade);
          }

          // Check if the trade entry date is within the current month
          if (tradeDate >= startOfMonth && tradeDate <= today) {
            monthly.push(trade);
          }
        });

        setDailyTrades(daily);
        setWeeklyTrades(weekly);
        setMonthlyTrades(monthly);
        console.log(daily);
      } catch (error) {
        console.error("Error fetching trades:", error);
      }
    };

    fetchAndCategorizeTrades();
  }, []);

  const renderTrades = (trades) => {
    const totalTrades = trades.length;
    const winningTrades = trades.filter((trade) => trade.profitLoss > 0).length;
    const winRate =
      totalTrades > 0 ? ((winningTrades / totalTrades) * 100).toFixed(2) : "0";

    const totalPnL = trades
      .reduce(
        (acc, trade) =>
          acc + (trade.exitPrice - trade.entryPrice) * trade.contracts,
        0
      )
      .toFixed(2);
    const totalEntry = trades
      .reduce((acc, trade) => acc + trade.entryPrice * trade.contracts, 0)
      .toFixed(2);
    const pnlPercentage =
      totalEntry > 0 ? ((totalPnL / totalEntry) * 100).toFixed(2) : "0";

    return (
      <div>
        {trades.map((trade) => (
          <div key={trade.id} className="trade-item">
            <div className="left-column">
              {trade.symbol} {trade.optionType} ${trade.strikePrice}{" "}
              {trade.expDate.split("-").slice(1).join("/")}
            </div>
            <div className="middle-column">
              ${trade.entryPrice.toFixed(2)} - ${trade.exitPrice.toFixed(2)}
            </div>
            <div className="right-column">
              {(
                ((trade.exitPrice - trade.entryPrice) / trade.entryPrice) *
                100
              ).toFixed(2)}
              %
            </div>
          </div>
        ))}
        <hr className="hr-bar"></hr>
        <div className="win-rate">
          <span className="title">Win Rate:</span>
          <span className="value">
            {winningTrades}/{totalTrades}
          </span>
          <span className="percent">{winRate}%</span>
        </div>
        <div className="pnl-rate">
          <span className="title">P/L:</span>
          <span className="value">${totalPnL}</span>
          <span className="percent">{pnlPercentage}%</span>
        </div>
      </div>
    );
  };

  return (
    <div className="trade-summary">
      <div className="trade-category">
        <div className="header">
          <p>Daily</p>
        </div>
        {renderTrades(dailyTrades)}
      </div>
      <div className="trade-category">
        <div className="header">
          <p>Weekly</p>
        </div>
        {renderTrades(weeklyTrades)}
      </div>
      <div className="trade-category">
        <div className="header">
          <p>Monthly</p>
        </div>
        {renderTrades(monthlyTrades)}
      </div>
      <div className="trade-category">
        <div className="header">
          <p>Sort</p>
        </div>
        <div className="analysis-sort">
          <Sort />
        </div>
      </div>
    </div>
  );
};

export default TradeSum;

